import React from 'react'
import "./App.css"
import ProductCard from './components/ProductCard'

const App = () => {
  return (
    <div>
      <p>Hello, World</p>
      <ProductCard title={'Nonono'} price={`${Math.round(Math.random() * 1000)}$`} />
    </div>
  )
}

export default App
